`,z.jsx(a.p,{children:"Many people assume native gardens are “wild” or hard to manage, but actually the opposite is true.  Keystone plants are adapted to local soils and climate, so once established, they thrive with minimal care. They don’t need constant watering, fertilizer, or pesticides, because they’re perfectly suited to the environment they evolved in."}),`
